import React from 'react';
import './App.css';
import "./tailwind.output.css"

function App() {
  return (
    <div className="bg-white">
      <header>
        <div className="container mx-auto px-6 py-3">
          <div className="w-full text-gray-700 md:text-center text-2xl font-semibold">
            Brand
          </div>
        </div>

      </header>
    </div>
  );
}

export default App;
